    @fluid_property_type.setter
    def fluid_property_type(self, value=None):
        """  Corresponds to IDD Field `Fluid Property Type`
        Enthalpy Units are J/kg
        Density Units are kg/m3

        Args:
            value (str): value for IDD Field `Fluid Property Type`
                Accepted values are:
                      - Enthalpy
                      - Density
                if `value` is None it will not be checked against the
                specification and is assumed to be a missing value

        Raises:
            ValueError: if `value` is not a valid value
        """
        if value is not None:
            try:
                value = str(value)
            except ValueError:
                raise ValueError('value {} need to be of type str'
                                 ' for field `FluidPropertiesSuperheated.fluid_property_type`'.format(value))
            if ',' in value:
                raise ValueError('value should not contain a comma '
                                 'for field `FluidPropertiesSuperheated.fluid_property_type`')
            if '!' in value:
                raise ValueError('value should not contain a ! '
                                 'for field `FluidPropertiesSuperheated.fluid_property_type`')
            vals = {}
            vals["enthalpy"] = "Enthalpy"
            vals["density"] = "Density"
            value_lower = value.lower()
            if value_lower not in vals:
                found = False
                if not self.strict:
                    for key in vals:
                        if key in value_lower or value_lower in key:
                            value_lower = key
                            found = True
                            break
                    if not found:
                        value_stripped = re.sub(r'[^a-zA-Z0-9]', '', value_lower)
                        for key in vals:
                            key_stripped = re.sub(r'[^a-zA-Z0-9]', '', key)
                            if key_stripped == value_stripped:
                                value_lower = key
                                found = True
                                break
                if not found:
                    raise ValueError('value {} is not an accepted value for '
                                     'field `FluidPropertiesSuperheated.fluid_property_type`'.format(value))
                else:
                    logger.warn('change value {} to accepted value {} for '
                                 'field `FluidPropertiesSuperheated.fluid_property_type`'.format(value, vals[value_lower]))
            value = vals[value_lower]
        self._data["Fluid Property Type"] = value

